    return (
        <div className={"w-[380px] bg-[#3D3B40] p-1"}>
            <div className={"bg-[#3D3B40] text-white p-2"}>Chats</div>
            <SearchBar/>
            <ChatPreview/>
            <ChatPreview/>
        </div>
    );
}
export default Panel;
